import React, { createContext } from 'react';
import A from './A';
const FirstN = createContext();
const LastN = createContext();
const App = () => {
  return (
    <><FirstN.Provider value={"GulAhmad"}>
    <LastN.Provider value={"K-Abo"}>
      
    </LastN.Provider>
      <A />
    </FirstN.Provider>
    </>
  )
}
export default App;
export {FirstN, LastN};
